import React from "react";
import { Text, View } from "react-native";
import * as Font from "expo-font";
// import { useFonts } from "@use-expo/font";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import AppLoading from "expo-app-loading";
import {
	useFonts,
	AlfaSlabOne_400Regular,
} from "@expo-google-fonts/alfa-slab-one";
import { BowlbyOneSC_400Regular } from "@expo-google-fonts/bowlby-one-sc";

import HomeScreen from "./app/screens/HomeScreen";
import DetailsScreen from "./app/screens/DetailsScreen";

const Stack = createNativeStackNavigator();
const StackNavigator = () => (
	<Stack.Navigator
		screenOptions={{
			headerStyle: { backgroundColor: "rebeccapurple" },
			headerTintColor: "white",
			headerFontFamily: "AlfaSlabOne_400Regular",
		}}
	>
		<Stack.Screen name="Home" component={HomeScreen} />
		<Stack.Screen name="Details" component={DetailsScreen} />
	</Stack.Navigator>
);

export default function App() {
	let [fontsLoaded] = useFonts({
		AlfaSlabOne_400Regular,
		BowlbyOneSC_400Regular,
	});

	if (!fontsLoaded) {
		return <AppLoading />;
	}
	// from the custom App we return the component we assigned to RootApp.
	// return (
	// 	<NavigationContainer>
	// 		<StackNavigator />
	// 	</NavigationContainer>
	// );

	return (
		<View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
			<Text
				style={{
					fontFamily: "BowlbyOneSC_400Regular",
				}}
			>
				Bowlby One SC Regular
			</Text>
		</View>
	);
}
